import React  from 'react';
import PropTypes from 'prop-types';
import { Navbar, NavbarToggler, NavbarBrand, Nav, NavItem, NavLink, Collapse } from 'reactstrap';
import IBase from '../Base.js';
import IDropdown from '../dropdown/Dropdown.js';
import _ from 'lodash';

const propTypes = {
    brand: PropTypes.string,
    color: PropTypes.string,
    navItems: PropTypes.arrayOf(PropTypes.exact({
                                    name: PropTypes.string,
                                    link: PropTypes.string,
                                    navItems: PropTypes.exact({
                                        name: PropTypes.string,
                                        link: PropTypes.string
                                  })}))
};

const defaultProps = {
    brand: "Brand",
    color: "light",
    navItems: []
};

class INav extends IBase {

    constructor(props) {
        super(props);
        this.state = {
            navItemsVisible : false,
            ...this.state
        };
      }

  toggleNavbar = () => {this.setState({navItemsVisible: !this.state.navItemsVisible});}

  render() {
    let {
      brand,
      color,
      navItems,
      ...attributes
    } = this.props;

    navItems = _.map(navItems, (navItem) => {
        return (<NavItem><NavLink href={navItem.link}>{navItem.name}</NavLink></NavItem>);
    });

    const nav = (
      <Navbar fixed='top' color={color} light expand="md">
        <NavbarBrand href="/" className="mr-auto"> {brand} </NavbarBrand>
        <NavbarToggler onClick={this.toggleNavbar} className="mr-2" />
        <Collapse isOpen={this.state.navItemsVisible} navbar>
          <Nav className="mr-auto" navbar>
            <NavItem><NavLink href="/">"q"</NavLink></NavItem>
            <NavItem><NavLink href="/">"q"</NavLink></NavItem>
            <IDropdown color={color} size="sm" direction="right" actions={[{name: '1', status: 'header'}, {name: '2', status: 'text'}]}/>
          </Nav>
        </Collapse>
      </Navbar>
    );

    return super.render(nav);
  }
}

INav.propTypes = propTypes;
INav.defaultProps = defaultProps;
INav.displayName = 'INav';

export default INav;
